'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The class for for getting response on 'logic error' message")
class LogicErrorMessage {
    error;
    constructor() {
        this.error = null;
    }
    getType() {
        return MessageType.LogicError;
    }
    getError() {
        return this.error;
    }
}
module.exports = LogicErrorMessage
